import "./HeroImgStyles.css";

import React from 'react'
import IntroImg from "../assets/bg-land-test.jpg"

const HeroImg = () => {
  return (
    <div className="mask">
      <img className="into-img" src={IntroImg} alt="Landscape Test"/>
    </div>
  )
}

export default HeroImg
